import './App.css';
import Props from './Components/Props';
import data from './Data';

import '../node_modules/bootstrap/dist/css/bootstrap.min.css'




function App() {


  return (
    <div className="App">
      <>
        <div className='container my-5'>
          <div className='row'>



          {data.map((values)=>{
            return(
              <>
                 <Props 
                   imgsrc={values.imgsrc}
            title={values.title}
            text={values.text}
            btn={values.btn}
             />
            </>
            )
          })}


          </div>
        </div>



      </>
    </div>
  );
}

export default App;
